import React, { Component } from "react";
import MenuCategory from "./MenuCategory";
import SelectButton from "./SelectButton";

class AllCategories extends Component {
	state = {};

	menuUpdated = () => {};

	render() {
		return (
			<div className="container">
				<ul className="collapsible">
					<MenuCategory id="filling" menuUpdated={menuUpdated} />
				</ul>
				<ul className="collapsible">
					<MenuCategory id="rice" menuUpdated={menuUpdated} />
				</ul>
				<ul className="collapsible">
					<MenuCategory id="beans" menuUpdated={menuUpdated} />
				</ul>
				<ul className="collapsible">
					<MenuCategory id="topthingsoff" menuUpdated={menuUpdated} />
				</ul>
				<ul className="collapsible">
					<MenuCategory id="options" menuUpdated={menuUpdated} />
				</ul>
				<ul className="collapsible">
					<MenuCategory id="side" menuUpdated={menuUpdated} />
				</ul>
				<ul className="collapsible">
					<SelectButton menuUpdated={menuUpdated} />
				</ul>
			</div>
		);
	}
}

export default AllCategories;
